import React, { useContext } from 'react';
import { AppContext } from '../contexts/AppContext';

const ExpenseReport: React.FC = () => {
    const { expenses } = useContext(AppContext);

    const renderExpenses = () => {
        return expenses.map((expense, index) => (
            <tr key={index}>
                <td>{expense.date}</td>
                <td>{expense.amount}</td>
                <td>{expense.category}</td>
            </tr>
        ));
    };

    return (
        <div className="p-4">
            <h2 className="text-xl font-bold mb-4">Expense Report</h2>
            <table className="min-w-full bg-white border border-gray-300">
                <thead>
                    <tr>
                        <th className="border-b-2 border-gray-300 px-4 py-2">Date</th>
                        <th className="border-b-2 border-gray-300 px-4 py-2">Amount</th>
                        <th className="border-b-2 border-gray-300 px-4 py-2">Category</th>
                    </tr>
                </thead>
                <tbody>
                    {renderExpenses()}
                </tbody>
            </table>
        </div>
    );
};

export default ExpenseReport;
